import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import {newItem} from "../../../Redux/later-seen-reducer";
import AllOrder from "./AllOrder";


class AllOrderContainer extends React.Component {


    render() {

        let ids

        if (this.props.match.params.id - 1 < 14) {
            this.props.newItem(this.props.pizza[this.props.match.params.id - 1], this.props.ves, this.props.size)
            ids=this.props.match.params.id - 1

        } else if (this.props.match.params.id - 1 >= 14 && this.props.match.params.id - 1 < 20) {

            this.props.newItem(this.props.drink[this.props.match.params.id - 14])
            ids=this.props.match.params.id - 14


        } else if (this.props.match.params.id - 1 >= 20 && this.props.match.params.id - 1 < 33) {

            this.props.newItem(this.props.sneks[this.props.match.params.id - 20])
            ids=this.props.match.params.id - 20


        } else if (this.props.match.params.id - 1 >= 33 && this.props.match.params.id - 1 < 41) {

            this.props.newItem(this.props.sous[this.props.match.params.id - 33])
            ids=this.props.match.params.id - 33

        }

        return (


            <AllOrder pizza={this.props.pizza} number={ids}
                      size={this.props.size} ves={this.props.ves} newItem={this.props.newItem} sous={this.props.sous}
                      sneks={this.props.sneks} drink={this.props.drink}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        pizza: state.pizzaPage.pizza,
        size: state.pizzaPage.siza,
        ves: state.pizzaPage.ves,
        sous: state.sousPage.sous,
        sneks: state.sneksPage.sneks,
        drink: state.drinkPage.drink,


    }


}

export default compose(
    connect(mapStateToprops, {newItem}),
    withRouter,
)(AllOrderContainer)
